  let PLAYESTATE = {};
  let PLAYERSTATS = {};
  let doDeleteBlock;
  let allDoneWords = localStorage.getItem('allDoneWords');
  let tips = localStorage.getItem('tips');
  let sounds = localStorage.getItem('sounds');
  let isAdvShowed = localStorage.getItem('isAdvShowed');
  let isGameAdvShow = localStorage.getItem('isGameAdvShow');
  let isGameUpdate = localStorage.getItem('gameUpdate-1');
  let cantSaveData = localStorage.getItem('cantSaveData');
  isAdvShowed = !!isAdvShowed;
  isGameUpdate = !isGameUpdate;
  let loc = 0;
  let allStars = [];
  let isRules = false;
  let allLocations = Math.floor(allWords.length / 21);
  let lastLevel = 0;
  function fixDoneWords(allDoneWords) {
    let keys = Object.keys(allDoneWords);
    for(let i = 0; i < keys.length; i++){

      let k = keys[i];
      if(keys[i].indexOf('ё') !== -1){
        k = k.replace(/ё/g, 'е');
      }else if(k === "ассиметрия"){
        console.log('асс');
        k = "асимметрия";
      }
      let words = allDoneWords[keys[i]] || allDoneWords[k];

      if(words === 1){
        allDoneWords[k] = wordsFromWords[k];
        if(k === "асимметрия"){
          delete allDoneWords["ассиметрия"];
        }
      }else{
        if(keys[i].indexOf('ё')  !== -1){
          words = words.map((word)=>word.replace(/ё/g, 'е'));
        }

        delete allDoneWords[keys[i]];

        if(words.length > 0){
          let allWords = wordsFromWords[k];
          if(allWords){
            words = words.filter((word)=>allWords.includes(word));
            allDoneWords[k] = words;
          }

        }
      }


    }
    return allDoneWords;
  }
  if(allDoneWords){
    allDoneWords = fixDoneWords(JSON.parse(allDoneWords));
    tips = Number(tips);
    sounds = sounds === 'true';
    setLoc();
    isGameAdvShow = !isGameAdvShow;
  }else{
    allDoneWords = {};
    isGameAdvShow = false;
    isGameUpdate = false;
    tips = 3;
    isRules = true;
    sounds = true;
    localStorage.setItem('sounds', true);
    localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
    localStorage.setItem('tips', 3);

    allWords.forEach((key => {
      allDoneWords[key] = [];
    }));
    for(let i = 0; i < allWords.length; i++){
      allStars.push(0);
    }
  }

  let recentState = JSON.stringify(PLAYESTATE);
  let recentStats = JSON.stringify(PLAYERSTATS);


  function setState(isNow) {
    const newData = JSON.stringify(PLAYESTATE);
    if(recentState === newData) return;
    console.log('setState');
    recentState = newData;
    if (playerGame) {
      //Если нет возможности сохранить в компрессованном виде, сохраняем в обычном
      if(cantSaveData){

        playerGame.setData(
            {
              allDoneWords: replaceLevelsToOne(PLAYESTATE.allDoneWords),
              cantSaveData: true
            }, isNow)
            .then((ignored) => {})
        return;
      }

      const newState = {
        allDoneWords: compressData(PLAYESTATE.allDoneWords)
      };

      playerGame.setData(newState, isNow).then((ignored) => {
      }).catch(() => {
        playerGame.setData(newState, isNow).then((ignored) => {
        }).catch(() => {
          playerGame.setData({allDoneWords: replaceLevelsToOne(PLAYESTATE.allDoneWords)}, isNow).then((ignored) => {
          }).catch(() => {
            localStorage.setItem('offline', '1');
          });
        })
      });

    }
  }
  function setStats(isNow) {
    const newData = JSON.stringify(PLAYERSTATS);
    if(recentStats === newData) return;
    recentStats = newData;
    if(playerGame) playerGame.setStats(PLAYERSTATS, isNow).then((ignored) => {}).catch(()=>{
      playerGame.setStats(PLAYERSTATS, isNow).then((ignored) => {})
    });
  }

  function saveAllData(isNow){
    console.log('saveAllData');
    setState(isNow);
    setStats(isNow);
  }

  window.onblur = () => saveAllData(true);
  window.onunload = () => saveAllData(true);
  window.onunload = () => saveAllData(true);
  window.onpagehide = () => saveAllData(true);

  setInterval(()=>{
    saveAllData(false);
  }, 15000);



  function setLastLevel() {
    for(let i = allWords.length-1; i >= 0 ; i--){
      if(allDoneWords[allWords[i]].length > 0){
        console.log('last level, ', i);
        lastLevel = i;
        break;
      }
    }
  }

  function setLoc() {
    allWords.forEach((key => {
      if(allDoneWords[key]){
        allStars.push(testStar(allDoneWords[key].length, wordsFromWords[key].length))
      }else{
        allDoneWords[key] = [];
        allStars.push(0);
      }
    }));
    localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
    setLastLevel();
    loc = Math.floor((lastLevel / 21));
    if(allStars.reduce((acc, st)=>{
      return acc + st;
    }, 0) < loc*32){
      loc--;
    }
    if(loc >= allLocations || loc < 0) loc = 0;
  }
  if(window.YaGames){
    window.YaGames.init({
      adv: {
        onAdvClose: wasShown => {
          if(!wasShown) {
            advTime = true;
          }

          canShowAdv();
        }
      }
    }).then(ysdk => {
      YSDK = ysdk;
      initPlayer(ysdk);
      var isNativeCache = ysdk.yandexApp && ysdk.yandexApp.enabled;
      if ('serviceWorker' in navigator && !isNativeCache) {
        window.onload = function(){
          navigator.serviceWorker
                  .register('sw.js')
                  .then(function(reg) {
                    console.log('Registration succeeded. Scope is ' + reg.scope);
                  })
                  .catch(function(error) {
                    console.error('Trouble with sw: ', error);
                  });
        };
      }
      showAdv = () => {
        ysdk.adv.showFullscreenAdv({
          callbacks: {
            onClose: function() {

              advTime = false;
              canShowAdv();

              setTimeout(()=>{
                advTime = true;
                console.log('set to true');
                canShowAdv();
              }, 190000);
            }
          }
        });
      };
    }).catch(e=>{
      console.log(e);
      doDeleteBlock = true;
      update();
    });
  }else{
    localStorage.setItem('offline', '1');
    doDeleteBlock = true;
  }
  function update() {
    if (document.querySelector('.levels')) {
      document.querySelector('.levels').dispatchEvent(new CustomEvent("updateAll"));
